  angular.module('Pics', [])
    .controller('MainCtrl', [
      '$scope',
      function($scope) {
        $scope.test = 'Hello world!';
        $scope.names = ["Good", "Evil"];
        $scope.posts = [{
            title: 'Time in the Mountains',
            image: 'data:image/jpeg;base64,',
            contributor: "pexels.com",
            upvotes: 5,
            selectedValue: "Good"
          },
          {
            title: 'Sunset',
            image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRo-c5Y4YsIXIVkDe2lvXGEJVU4zA3xSWYrqNeQXNLTj6RbKnSZwg',
            contributor: "rgbstock.com",
            upvotes: 3,
            selectedValue: "Evil"
          },
          {
            title: 'Winding Path',
            image: 'data:image/jpeg;base64,',
            contributor: "stockvault.net",
            upvotes: 2,
            selectedValue: "Evil"
          }
        ]

        $scope.addPost = function() {
          $scope.posts.push({ title: $scope.title, image: $scope.imageURL, contributor: $scope.contributor, upvotes: 0, 
          selectedValue: $scope.selectedValue});
          $scope.title = "";
          $scope.imageURL = "";
          $scope.contributor = "";
          $scope.selectedValue = "";
        };
        
        $scope.restoreHealth = function(post) {
          post.upvotes += 5;
        }

        $scope.damage = function(post) {
          if (post.upvotes > 0) {
          post.upvotes -= 1;
          }
        };
      }
    ]);
  